        UDP = 17,
        ICMP = 1,
        IGMP = 2
    }
    public class FirewallEntry
    {
        public int Id { get; set; }
        public DateTime TimeStamp { get; set; }
        public string SendingHost { get; set; }
        public string In { get; set; }       // IN=
        public string Out { get; set; }      // OUT=
